import React, { Components } from 'react';
import Teams from './components/Teams'
import './App.css';

class App extends Component {
  state = {
    teams: [
      {
        id: 1,
        name: "Red Solo Kupp",
        platform: "NFL"
      }
    ]
  }
  render() {
    return (
      <div className="App">
        <Teams teams={this.state.teams}/>
      </div>
    );
  }
}

export default App;
